Definitely ATE 🥰 | 🎥 GRWM For Brunch ❤️ 

I’ve been in a soft makeup era for a while. On average can do my face in 20-30 minutes. On my eyes I typically stick to brown eyeshadow only but this day since I had red hair decided to go with a nude eyeshadow look which is still soft and neutral. I like my makeup looks to be quick with time and honestly it’s minimal effort for me 😅 I just like to be cute and done so yea my makeup routine is always the same nothing special 😌

Face Details: 
@maccosmetics studio fix NC50
@tartecosmetics shape tape “tan sand”
@bolivebeaute nude persuasion palette 
@sachacosmeticsofficial “buttercup” setting powder 
@absnyproducts brow pencil “smoke”
@urbandecaycosmetics “brownie” eyeliner pencil 
@narsissist “exhibit a” blush 

Hair @unicehair 

